import React from 'react';
import '../index.css';
import 'boxicons';

function Footer() {
  return (
    <footer>
      <p>&copy; Alexander Lehnbom</p>
      <a href="https://github.com/aleleh" target="_blank">
        <i className="bx bxl-github"></i>
      </a>
    </footer>
  );
}

export default Footer;
